// Testing set_bit
  assert( (reg = 0b00000000, set_bit(reg, 0), reg == 0b00000001) );
  assert( (reg = 0b00000000, set_bit(reg, 1), reg == 0b00000010) );
  assert( (reg = 0b00000000, set_bit(reg, 2), reg == 0b00000100) );
  assert( (reg = 0b00000000, set_bit(reg, 3), reg == 0b00001000) );
  assert( (reg = 0b00000000, set_bit(reg, 4), reg == 0b00010000) );
  assert( (reg = 0b00000000, set_bit(reg, 5), reg == 0b00100000) );
  assert( (reg = 0b00000000, set_bit(reg, 6), reg == 0b01000000) );
  assert( (reg = 0b00000000, set_bit(reg, 7), reg == 0b10000000) );
  assert( (reg = 0b00000001, set_bit(reg, 0), reg == 0b00000001) );
  assert( (reg = 0b00000001, set_bit(reg, 1), reg == 0b00000011) );
  assert( (reg = 0b00000001, set_bit(reg, 2), reg == 0b00000101) );
  assert( (reg = 0b00000001, set_bit(reg, 3), reg == 0b00001001) );
  assert( (reg = 0b00000001, set_bit(reg, 4), reg == 0b00010001) );
  assert( (reg = 0b00000001, set_bit(reg, 5), reg == 0b00100001) );
